// Import Styled
import styled from 'styled-components';

export const IconCode = styled.text`
	box-sizing: border-box;
	background: none;
	color: #fff;
	margin-right: 8px;
	svg{
		font-size: 16px;
		color: #6271D2;
	}
	.roundIcon{
		background-color: #EFF0FA;
		vertical-align: top;    
		position: relative;
    	top: 8px;
	}
`;
